Insane. 

We’ve been waiting a while I know, but it felt so good last night to show this film at the right time. On the big screen! Despite us not all being together during the premiere of Black Widow the night was still such a special memory. Thank you to all the fans in attendance, the costumes and dedication to detail was CRAZY! 
Last nights look was a creation we are all so proud of, thank you @miumiu for this incredible two piece and all the seamstresses that made it perfect AND of course my beautiful @bulgari jewels kept me twinkling all night. 

My Glam Team did it again. So happy and so proud of what we’ve cooked up this tour, THANK YOU you magical talented beans..
